import React from 'react';
import { Link } from "react-router-dom";

const Navbar = (props) => {

    return(
      <>
        <ul id = "navbar">
          <li className = "navitem"><Link to ="/park_overview">Park</Link></li>
          <li className = "navitem">Paddocks</li>
          <li className = "navitem">Dinosaurs</li>
        </ul>
      </>
    );

}

export default Navbar;
